DROP DATABASE IF EXISTS toy;
CREATE DATABASE IF NOT EXISTS toy CHARACTER SET utf8 COLLATE utf8_general_ci;
USE toy;

CREATE TABLE user (
    id int,
    name varchar(255)
) CHARACTER SET utf8 COLLATE utf8_general_ci;



CREATE TABLE products (
    id BIGINT AUTO_INCREMENT,
    product_name varchar(255),
    product_brand varchar(255),
    quantity int,
    product_price double,
    image_url varchar(255),
    updated timestamp DEFAULT current_timestamp,
    created timestamp DEFAULT current_timestamp ON UPDATE current_timestamp,
    PRIMARY KEY (id)
) CHARACTER SET utf8 COLLATE utf8_general_ci;


CREATE TABLE orders (
    id BIGINT AUTO_INCREMENT,
    shipping_method varchar(50),
    total_price double,
    transaction_id varchar(255) DEFAULT '',
    status ENUM('created','completed','cancle','fail') DEFAULT 'created',
    authorized timestamp DEFAULT current_timestamp,
    updated timestamp DEFAULT current_timestamp,
    created timestamp DEFAULT current_timestamp ON UPDATE current_timestamp,
    PRIMARY KEY (id)
) CHARACTER SET utf8 COLLATE utf8_general_ci;

VALUE (8004359103,14.59);

CREATE TABLE order_product (
    order_id BIGINT,
    product_id BIGINT,
    quantity int,
    product_price double
) CHARACTER SET utf8 COLLATE utf8_general_ci;

VALUE (1, 2, 10, 1199.5);
VALUE (1, 1, 10, 129.5);

CREATE TABLE shipping (
    id int AUTO_INCREMENT,
    order_id BIGINT,
    address varchar(255),
    sub_district varchar(255),
    district varchar(255),
    province varchar(255),
    zip_code varchar(5),
    recipient varchar(255),
    phone_number varchar(13),
    updated timestamp DEFAULT current_timestamp,
    created timestamp DEFAULT current_timestamp ON UPDATE current_timestamp,
    PRIMARY KEY (id)
) CHARACTER SET utf8 COLLATE utf8_general_ci;
